import React, {useState} from 'react';

const style = {
  border: "1px solid black",
  padding: '1px',
  margin: '1px'
};

function ValueControl(props) {
  return (
    <div style={{border: "1px solid black"}}>
      {props.name}
      <input value={props.value}/>  {props.unit}
      <button>++</button><button>++</button>
    </div>
  );
}

export default function ChannelControl(props) {
  return (
    <div style={style}>
      Channel {props.channel}
      <button>Active</button> <br/>
      <ValueControl name="Offset" value="123" unit="mV"/>
    </div>
  )
}
